		* igrf_2.h__[ih + 3] - y * (igrf_2.h__[ih + 2] + igrf_2.h__[
		ih - 1]);
	igrf_2.h__[il] = model_1.g[il] + z__ * igrf_2.h__[ih] + y * 
		igrf_2.h__[ih + 3] + x * (igrf_2.h__[ih + 2] - igrf_2.h__[ih 
		- 1]);
