/*       file into an array. */

/*       Input: */
/*           IU    - Logical unit number */
/*           IFILE - File index */

/*       Output: */
/*           NMAX  - Maximum degree and order of model */
/*           ERAD  - Earth's radius associated with the spherical */
/*                   harmonic coefficients, in the same units as */
/*                   elevation */
