{
    /* Initialized data */

    static integer tabm[12] = { 0,31,59,90,120,151,181,212,243,273,304,334 };
    static real stepj = (float)15.;
    static integer istepj = 15;

    /* System generated locals */
    integer i__1, i__2, i__3, i__4;
    real r__1, r__2, r__3;
    doublereal d__1;

    /* Builtin functions */
    double r_lg10(real *), pow_dd(doublereal *, doublereal *);

    /* Local variables */
    real edenijkl[2];
    integer i__, j, l, m;
    real h1;
    integer i1, i2, j1, j2, k1, k2, l1, l2, m1, m2;
    real el;
    integer mh, mon;
    real deg1, f107l, day1, xhi1, flx1, edeni[16]	/* was [2][2][2][2] */
	    , edenij[8]	/* was [2][2][2] */, edenijk[4]	/* was [2][2] */;

/* --------------------------------------------------------------------- */
/*     PURPOSE: */
/*     THIS SUBROUTINE COMPUTES "FIRI" ELECTRON DENSITIES */

/*     COMMON BLOCK REQUIRED: */
/*       REAL EDEN,TABHE,TABLA,TABMO,TABZA,TABFL */
/*       COMMON/FIRCOM/EDEN(81,5,12,12,3), */
/*      1              TABHE(81),TABLA(5),TABMO(12),TABZA(12),TABFL(3) */

/*       ARRAY EDEN contains LOG10(tabulated electron density, */
/*       ordered in (height,latitude,month,zenithangle,f107) */
/*       Quantity      Minimum  Maximum  Number of steps */
/*       Height        60       140      81 */
/*       Latitude       0        60       5 */
/*       Month          1        12      12 */
/*       Zenith angle   0       180      12 */
/*       F10.7         75       200       3 */

/*     PARAMETERS: */
/*        HGT   height in km (input, REAL) */
/*        GLAT1 latitude in degrees, north is positive (input, REAL) */
/*        IDAY  day of the year (input, INTEGER) */
/*        ZANG  solar zenith angle in degrees (input, REAL) */
/*        F107T 10.7cm flux in Ja (input, REAL) */
/*        EDENS model electron density in m**-3 (output, REAL) */
/*        IERROR  Error code (INTEGER, output) */

/*       Error code */
/*         0         no error */
/*         1         model undefined for given combination of input */
/*                   parameters, output is set to zero */
/*         2         input parameters outside valid range, output is invalid */
/*         3         both error conditions detected, output is zero */

/*     USAGE */
/*        CALL F00(HGT,GLAT1,IDAY,ZANG,F107T,EDENS,IERROR) */

/*     SUBROUTINES AND FUNCTION SUBPROGRAMS REQUIRED */
/*        none */

/*     WRITTEN BY K. TORKAR, IWF GRAZ */
/*     Klaus.Torkar@oeaw.ac.at */

/*     LAST MODIFICATION:  06.07.2001 */

/*     VERSION: 1.1 */

/*     ------------------------------------------------------------------ */






/*     INDICES: */
/*     I=HEIGHT, J=LATITUDE, K=MONTH, L=ZANG, M=F10.7 */

/*     CHECK INPUT */

    *ierror = 0;
/* Computing MIN */
    r__2 = (float)1e3, r__3 = dmax((float)1.,*f107t);
    r__1 = dmin(r__2,r__3);
    f107l = r_lg10(&r__1);
    if (*hgt < fircom_1.tabhe[0] || *hgt > fircom_1.tabhe[80] || *glat1 > 
	    fircom_1.tabla[4] || *glat1 < -fircom_1.tabla[4] || *iday < 1 || *
	    iday > 366 || *zang < fircom_1.tabza[0] || *zang > fircom_1.tabza[
	    11] || f107l < fircom_1.tabfl[0] || f107l > fircom_1.tabfl[2]) {
	*ierror = 2;
    }

/*     assume height table is in 1 km steps from 60 to 140 km */
/* Computing MIN */
    i__1 = 80, i__2 = (integer) (*hgt) - 59;
    i__ = min(i__1,i__2);
    if (i__ < 1) {
	i__ = 1;
    }
    h1 = *hgt - fircom_1.tabhe[i__ - 1];
    i1 = i__;
    i2 = i__ + 1;

/*     assume latitude table is in 15 deg steps from 0 to 60 deg */
/* Computing MAX */
/* Computing MIN */
    i__3 = 4, i__4 = (integer) dabs(*glat1) / istepj;
    i__1 = 1, i__2 = min(i__3,i__4);
    j = max(i__1,i__2);
    deg1 = (dabs(*glat1) - fircom_1.tabla[j - 1]) / stepj;
    j1 = j;
    j2 = j + 1;

/*     assume month table is given for each month */
    mon = 12;
    while(tabm[mon - 1] > *iday) {
	--mon;
    }
    day1 = (real) (*iday - tabm[mon - 1] - 15) / (float)30.;
    if (day1 < (float)0.) {
	--mon;
    }
    if (mon >= 1 && mon <= 11) {
	k1 = mon;
	k2 = mon + 1;
    } else {
	k1 = 12;
	k2 = 1;
    }

/*     assume zenith angle table has 12 entries between 0 and 180 deg */
    for (l = 2; l <= 11; ++l) {
	if (*zang < fircom_1.tabza[l - 1]) {
	    goto L1;
	}
    }
    l = 12;
L1:
    --l;
    l1 = l;
    l2 = l + 1;
    xhi1 = (*zang - fircom_1.tabza[l1 - 1]) / (fircom_1.tabza[l2 - 1] - 
	    fircom_1.tabza[l1 - 1]);

/*     assume solar activity table has 3 entries */
/* Computing MIN */
    r__1 = fircom_1.tabfl[2], r__2 = dmax(fircom_1.tabfl[0],f107l);
    f107l = dmin(r__1,r__2);
    if (f107l < fircom_1.tabfl[1]) {
	m1 = 1;
	m2 = 2;
    } else {
	m1 = 2;
	m2 = 3;
    }
    flx1 = (f107l - fircom_1.tabfl[m1 - 1]) / (fircom_1.tabfl[m2 - 1] - 
	    fircom_1.tabfl[m1 - 1]);

/*     ADJUST SOUTHERN LATITUDES TO NORTH AND MONTH+6 */

    if (*glat1 < (float)0.) {
	k1 += 6;
	if (k1 > 12) {
	    k1 += -12;
	}
	k2 += 6;
	if (k2 > 12) {
	    k2 += -12;
	}
    }

/*     EDEN(hgt,lat,mon,zang,f107) */
/*          I   J   K   L    M */

    i__1 = m2;
    for (m = m1; m <= i__1; ++m) {

	mh = m + 1 - m1;
/*       INTERPOLATE IN HEIGHT I */
	i__2 = l2;
	for (l = l1; l <= i__2; ++l) {
	    if (fircom_1.eden[i1 + (j1 + (k1 + (l + m * 12) * 12) * 5) * 81 - 
		    63667] == (float)0. || fircom_1.eden[i2 + (j1 + (k1 + (l 
		    + m * 12) * 12) * 5) * 81 - 63667] == (float)0. || 
		    fircom_1.eden[i1 + (j2 + (k1 + (l + m * 12) * 12) * 5) * 
		    81 - 63667] == (float)0. || fircom_1.eden[i2 + (j2 + (k1 
		    + (l + m * 12) * 12) * 5) * 81 - 63667] == (float)0. || 
		    fircom_1.eden[i1 + (j1 + (k2 + (l + m * 12) * 12) * 5) * 
		    81 - 63667] == (float)0. || fircom_1.eden[i2 + (j1 + (k2 
		    + (l + m * 12) * 12) * 5) * 81 - 63667] == (float)0. || 
		    fircom_1.eden[i1 + (j2 + (k2 + (l + m * 12) * 12) * 5) * 
		    81 - 63667] == (float)0. || fircom_1.eden[i2 + (j2 + (k2 
		    + (l + m * 12) * 12) * 5) * 81 - 63667] == (float)0.) {
		*edens = (float)0.;
		++(*ierror);
		return 0;
	    }
	    if (*hgt < fircom_1.tabhe[0]) {
		edeni[((l + 1 - l1 + (mh << 1) << 1) + 1 << 1) - 14] = 
			fircom_1.eden[i1 + (j1 + (k1 + (l + m * 12) * 12) * 5)
			 * 81 - 63667];
		edeni[((l + 1 - l1 + (mh << 1) << 1) + 1 << 1) - 13] = 
			fircom_1.eden[i1 + (j2 + (k1 + (l + m * 12) * 12) * 5)
			 * 81 - 63667];
		edeni[((l + 1 - l1 + (mh << 1) << 1) + 2 << 1) - 14] = 
			fircom_1.eden[i1 + (j1 + (k2 + (l + m * 12) * 12) * 5)
			 * 81 - 63667];
		edeni[((l + 1 - l1 + (mh << 1) << 1) + 2 << 1) - 13] = 
			fircom_1.eden[i1 + (j2 + (k2 + (l + m * 12) * 12) * 5)
			 * 81 - 63667];
	    } else if (*hgt > fircom_1.tabhe[80]) {
		edeni[((l + 1 - l1 + (mh << 1) << 1) + 1 << 1) - 14] = 
			fircom_1.eden[i2 + (j1 + (k1 + (l + m * 12) * 12) * 5)
			 * 81 - 63667];
		edeni[((l + 1 - l1 + (mh << 1) << 1) + 1 << 1) - 13] = 
			fircom_1.eden[i2 + (j2 + (k1 + (l + m * 12) * 12) * 5)
			 * 81 - 63667];
		edeni[((l + 1 - l1 + (mh << 1) << 1) + 2 << 1) - 14] = 
			fircom_1.eden[i2 + (j1 + (k2 + (l + m * 12) * 12) * 5)
			 * 81 - 63667];
		edeni[((l + 1 - l1 + (mh << 1) << 1) + 2 << 1) - 13] = 
			fircom_1.eden[i2 + (j2 + (k2 + (l + m * 12) * 12) * 5)
			 * 81 - 63667];
	    } else {
		edeni[((l + 1 - l1 + (mh << 1) << 1) + 1 << 1) - 14] = 
			fircom_1.eden[i1 + (j1 + (k1 + (l + m * 12) * 12) * 5)
			 * 81 - 63667] + h1 * (fircom_1.eden[i2 + (j1 + (k1 + 
			(l + m * 12) * 12) * 5) * 81 - 63667] - fircom_1.eden[
			i1 + (j1 + (k1 + (l + m * 12) * 12) * 5) * 81 - 63667]
			);
		edeni[((l + 1 - l1 + (mh << 1) << 1) + 1 << 1) - 13] = 
			fircom_1.eden[i1 + (j2 + (k1 + (l + m * 12) * 12) * 5)
			 * 81 - 63667] + h1 * (fircom_1.eden[i2 + (j2 + (k1 + 
			(l + m * 12) * 12) * 5) * 81 - 63667] - fircom_1.eden[
			i1 + (j2 + (k1 + (l + m * 12) * 12) * 5) * 81 - 63667]
			);
		edeni[((l + 1 - l1 + (mh << 1) << 1) + 2 << 1) - 14] = 
			fircom_1.eden[i1 + (j1 + (k2 + (l + m * 12) * 12) * 5)
			 * 81 - 63667] + h1 * (fircom_1.eden[i2 + (j1 + (k2 + 
			(l + m * 12) * 12) * 5) * 81 - 63667] - fircom_1.eden[
			i1 + (j1 + (k2 + (l + m * 12) * 12) * 5) * 81 - 63667]
			);
		edeni[((l + 1 - l1 + (mh << 1) << 1) + 2 << 1) - 13] = 
			fircom_1.eden[i1 + (j2 + (k2 + (l + m * 12) * 12) * 5)
			 * 81 - 63667] + h1 * (fircom_1.eden[i2 + (j2 + (k2 + 
			(l + m * 12) * 12) * 5) * 81 - 63667] - fircom_1.eden[
			i1 + (j2 + (k2 + (l + m * 12) * 12) * 5) * 81 - 63667]
			);
	    }
	}

/*       INTERPOLATE IN LATITUDE J */
	for (l = 1; l <= 2; ++l) {
	    if (dabs(*glat1) > fircom_1.tabla[4]) {
		edenij[(l + (mh << 1) << 1) - 6] = edeni[((l + (mh << 1) << 1)
			 + 1 << 1) - 13];
		edenij[(l + (mh << 1) << 1) - 5] = edeni[((l + (mh << 1) << 1)
			 + 2 << 1) - 13];
	    } else {
		edenij[(l + (mh << 1) << 1) - 6] = edeni[((l + (mh << 1) << 1)
			 + 1 << 1) - 14] + deg1 * (edeni[((l + (mh << 1) << 1)
			 + 1 << 1) - 13] - edeni[((l + (mh << 1) << 1) + 1 << 
			1) - 14]);
		edenij[(l + (mh << 1) << 1) - 5] = edeni[((l + (mh << 1) << 1)
			 + 2 << 1) - 14] + deg1 * (edeni[((l + (mh << 1) << 1)
			 + 2 << 1) - 13] - edeni[((l + (mh << 1) << 1) + 2 << 
			1) - 14]);
	    }
	}

/*       INTERPOLATE IN MONTH K */
	edenijk[(mh << 1) - 2] = edenij[((mh << 1) + 1 << 1) - 6] + day1 * (
		edenij[((mh << 1) + 1 << 1) - 5] - edenij[((mh << 1) + 1 << 1)
		 - 6]);
	edenijk[(mh << 1) - 1] = edenij[((mh << 1) + 2 << 1) - 6] + day1 * (
		edenij[((mh << 1) + 2 << 1) - 5] - edenij[((mh << 1) + 2 << 1)
		 - 6]);

/*       INTERPOLATE IN ZENITH ANGLE L */
	edenijkl[mh - 1] = edenijk[(mh << 1) - 2] + xhi1 * (edenijk[(mh << 1) 
		- 1] - edenijk[(mh << 1) - 2]);
    }

    el = edenijkl[0] + flx1 * (edenijkl[1] - edenijkl[0]);

    d__1 = (doublereal) el;
    *edens = pow_dd(&c_b87, &d__1);

    return 0;
} /* f00_ */




