/* Subroutine */ int initialize_()
{
    /* Builtin functions */
    double atan(doublereal);

    /* Local variables */
    real pi;

    argexp_1.argmax = (float)88.;
    pi = atan((float)1.) * (float)4.;
    const_1.umr = pi / (float)180.;
    const1_2.humr = pi / (float)12.;
    const1_2.dumr = pi / (float)182.5;
    return 0;
} /* initialize_ */


