/* Subroutine */ int apf_(integer *iyyyy, integer *imn, integer *id, real *
	hour, integer *iap)
{
    /* Initialized data */

    static integer lm[12] = { 31,28,31,30,31,30,31,31,30,31,30,31 };

    /* System generated locals */
    integer i__1;

    /* Local variables */
    real f;
    integer i__, j1, j2, i9, jd, is, jy, jmn, nyd, iss, iiap[8], iybeg, ihour;

/* -------------------------------------------------------------------- */
/* Finds 3-hourly Ap indices for IRI-storm for given year IYYYY (yyyy), */
/* month (IMN), day (ID), and UT (HOUR, decimal hours). The indices are */
/* stored in IAP(13) providing the 13 3-hourly indices prior to HOUR. */
/* The 3-hour UT intervals during the day are: (0-3),)3-6),)6-9),9-12, */
/* 12-15,15-18,18-21,)21-24(. */
/* If date is outside the range of the Ap indices file than iap(1)=-5 */
/* -------------------------------------------------------------------- */
/*     Fortran include file storing common blocks and associated */
/*     parameters. */

/*     Changelog: */
/*       2015-04-16     Created (Joseph Nicholas) */
/*     parameter (MAXRECORDLEN_IGRZ = 722) */
    /* Parameter adjustments */
    --iap;

    /* Function Body */
    jy = ap_1.ints_ap__[0];
    iybeg = jy + 1900;
    for (i__ = 1; i__ <= 8; ++i__) {
	iap[i__] = -1;
    }
    if (*iyyyy < iybeg) {
	goto L21;
    }
/* file starts at Jan 1, 1958 */
    is = 0;
    if (*iyyyy > iybeg) {
	i__1 = *iyyyy - 1;
	for (i__ = iybeg; i__ <= i__1; ++i__) {
	    nyd = 365;
	    if (i__ / 4 << 2 == i__) {
		nyd = 366;
	    }
	    is += nyd;
	}
    }
    lm[1] = 28;
    if (*iyyyy / 4 << 2 == *iyyyy) {
	lm[1] = 29;
    }
    i__1 = *imn - 1;
    for (i__ = 1; i__ <= i__1; ++i__) {
	is += lm[i__ - 1];
    }
    is += *id;
    ihour = (integer) (*hour / (float)3.) + 1;
    if (ihour > 8) {
	ihour = 8;
    }
    if ((is << 3) + ihour < 13) {
	goto L21;
    }
/* at least 13 indices available */
    if (is < 1 || is > ap_1.num_records_ap__) {
	goto L21;
    }
    jy = ap_1.ints_ap__[is * 11 - 11];
    jmn = ap_1.ints_ap__[is * 11 - 10];
    jd = ap_1.ints_ap__[is * 11 - 9];
    for (i__ = 1; i__ <= 8; ++i__) {
	iiap[i__ - 1] = ap_1.ints_ap__[i__ + 3 + is * 11 - 12];
    }
    f = ap_1.reals_ap__[is - 1];
    for (i9 = 1; i9 <= 8; ++i9) {
	if (iiap[i9 - 1] < -2) {
	    goto L21;
	}
    }
    j1 = 13 - ihour;
    i__1 = ihour;
    for (i__ = 1; i__ <= i__1; ++i__) {
	iap[j1 + i__] = iiap[i__ - 1];
    }
    iss = is - 1;
    if (iss < 1 || iss > ap_1.num_records_ap__) {
	goto L21;
    }
    jy = ap_1.ints_ap__[iss * 11 - 11];
    jmn = ap_1.ints_ap__[iss * 11 - 10];
    jd = ap_1.ints_ap__[iss * 11 - 9];
    for (i__ = 1; i__ <= 8; ++i__) {
	iiap[i__ - 1] = ap_1.ints_ap__[i__ + 3 + iss * 11 - 12];
    }
    f = ap_1.reals_ap__[iss - 1];
    for (i9 = 1; i9 <= 8; ++i9) {
	if (iiap[i9 - 1] < -2) {
	    goto L21;
	}
    }
    if (ihour > 4) {
	i__1 = j1;
	for (i__ = 1; i__ <= i__1; ++i__) {
	    iap[i__] = iiap[8 - j1 + i__ - 1];
	}
    } else {
	j2 = 5 - ihour;
	for (i__ = 1; i__ <= 8; ++i__) {
	    iap[j2 + i__] = iiap[i__ - 1];
	}
	iss = is - 2;
	if (iss < 1 || iss > ap_1.num_records_ap__) {
	    goto L21;
	}
	jy = ap_1.ints_ap__[iss * 11 - 11];
	jmn = ap_1.ints_ap__[iss * 11 - 10];
	jd = ap_1.ints_ap__[iss * 11 - 9];
	for (i__ = 1; i__ <= 8; ++i__) {
	    iiap[i__ - 1] = ap_1.ints_ap__[i__ + 3 + iss * 11 - 12];
	}
	f = ap_1.reals_ap__[iss - 1];
	for (i9 = 1; i9 <= 8; ++i9) {
	    if (iiap[i9 - 1] < -2) {
		goto L21;
	    }
	}
	i__1 = j2;
	for (i__ = 1; i__ <= i__1; ++i__) {
	    iap[i__] = iiap[8 - j2 + i__ - 1];
	}
    }
    goto L20;
/* 21      if(konsol.gt.1) write(konsol,100) */
/* L100: */
L21:
    iap[1] = -5;
L20:
    return 0;
} /* apf_ */



