/* h4=hmF2+150km, h5=hmF2+250km): */
/*       istep   h1-h2   h2-h3   h3-h4   h4-h5   h5-hend */
/*       0       2.0km   1.0km   2.5km   exponential approximation */
/*       1       2.0km   1.0km   2.5km   10.0km  30.0km */
/*       2       1.0km   0.5km   1.0km   1.0km   1.0km */

